;; gorilla-repl.fileformat = 1

;; **
;;; # EasyRider Levelling
;;; 
;;; **_Some plots of training effort vs level and attribute value for EasyRider._**
;;; 
;;; The basic idea behind training in EasyRider is that the training effort, @@E@@ should increase exponentially with the ability level, @@L@@. Or in other words, @@L@@ should be a function of the _logarithm_ of @@E@@:
;;; 
;;; $$ L = 1 + log\_B\Big(1 + \frac{E}{K}\Big) $$
;;; 
;;; Here @@log\_B@@ signifies "logarithm to the base B".
;;; 
;;; The logarithm of 1 is 0, so @@log\_B\Big(1 + \frac{E}{K}\Big)@@ will always be defined and greater than 0, increasing in proportion to effort divided by K.
;;; 
;;; The lowest level is 1, hence the leading "1 +" term.
;; **

;; @@
(ns easy-rider
  (:use gorilla-plot.core)
  (:use clojure.pprint)
  (:use clojure.repl)
  (:use hiccup.core))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
