;; **
;;; Define the training effort, number of level steps and consequent attribute ranges of speed, jump and health.
;;; 
;;; Note that these constants are from the current PvE configuration, which differs slightly from the plugin defaults. The latter use the vanilla minimum attribute value.
;; **

;; @@
(def speed {:name "Speed"
            :max-level 30 
            :max-effort 1000000.0
            :effort-scale 2000.0
            :min-value 0.174418605
            :max-value 0.3488372093
            :vanilla-max 0.3375
            :effort-units "m travelled"
            :display-units "m/s"
            :to-display (fn [attr] (* 43 attr))})

(def jump {:name "Jump"
           :max-level 20
           :max-effort 100000.0
           :effort-scale 2000.0
           :min-value 0.5737
           :max-value 1.1
           :vanilla-max 1.0
           :effort-units "m jumped"
           :display-units "m"
           :to-display (fn [attr]
                         (loop [y-vel attr
                                height 0]
                           (if (> y-vel 0)
                             (recur (* 0.98 (- y-vel 0.08))
                                    (+ height y-vel))
                             height)))})

(def health {:name "Health"
             :max-level 26
             :max-effort 10368.0
             :effort-scale 2700.0
             :min-value 15.0
             :max-value 40.0
             :vanilla-max 30.0             
             :effort-units "gold nuggets eaten"
             :display-units "â™¥"
             :to-display (fn [attr] (* 0.5 attr))})
