;; **
;;; The effort, @@E@@, that must be expended to train an ability to an integer level, @@L@@, is:
;;; 
;;; $$E = K \times (B ^ {L - 1} - 1)$$
;;; 
;;; Where:
;;; 
;;;  * @@K@@ = effort scale factor
;;;  * @@B@@ = effort exponential base
;;;  
;;; Note that the effort to increment the level increases exponentially as the level increases. However, as discussed below, the ability increases as a linear function of the level. So, training gives diminishing returns as the level increases.
;;; 
;;; The effort scale factor is chosen arbitrarily. The effort base can be computed by substituting in:
;;; 
;;;  * @@K@@ - the effort scale,
;;;  * @@E_{max}@@ - the maximum effort, and
;;;  * @@L_{max}@@ - the corresponding maximum level.
;;; 
;;; The effort scale factor is chosen arbitrarily. The effort base can be computed by substituting in the effort scale, @@K@@, the maximum effort, @@E\_\text{max}@@, and the corresponding maximum level, @@L\_\text{max}@@:
;;; 
;;; $$ B = \Big(1 + \frac{E\_\text{max}}{K}\Big) ^ {\frac{1}{L\_\text{max} - 1}} $$
;; **

;; @@
(def exponential-base
  (memoize 
    (fn [ability] 
      (let [E_max (:max-effort ability)
            L_max (:max-level ability)
            K (:effort-scale ability)]
        (Math/pow (+ 1 (/ E_max K)) (/ 1 (dec L_max)))))))

(defn effort-from-level [ability level]
  (let [K (:effort-scale ability)
        B (exponential-base ability)]
    (* K (- (Math/pow B (dec level)) 1))))

(defn log-base [base x]
  (/ (Math/log x) (Math/log base)))

(defn level-from-effort [ability effort]
  (let [B (exponential-base ability)
        K (:effort-scale ability)]
    (inc (log-base B (inc (/ effort K))))))
