;; **
;;; Compute internal Minecraft entity attribute values and corresponding displayed values from level:
;; **

;; @@
(defn linterp [min max frac]
  (+ (* min (- 1 frac))
     (* max frac)))

(defn attribute-value [ability level]
  (let [min (:min-value ability)
        max (:max-value ability)
        frac (/ (dec level) 
                (dec (:max-level ability)))]
    (linterp min max frac)))

(defn display-value [ability level]
  ((:to-display ability) (attribute-value ability level)))
