;; **
;;; Add some functions to set the axes labels:
;; **

;; @@
(defn axis-titles [plot x y]
   (-> plot
       (assoc-in [:content :axes] [{:orient "bottom" "scale" "x" :title x}
                                   {:orient "left"  "scale" "y" :title y}])))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;easy-rider/axis-titles</span>","value":"#'easy-rider/axis-titles"}
;; <=

;; **
;;; Define a function to plot the displayed values (not the internal attribute values, but the ones shown in the client) of an ability versus the level of training effort required:
;; **

;; @@
(defn plot-ability [ability]
  (let [L_max (:max-level ability)
        E_max (:max-effort ability)
        effort-for-level (map #(vector (effort-from-level ability %) %) (map inc (range L_max)))
        vanilla-effort-for-level (filter #(<= (attribute-value ability (second %)) 
                                              (:vanilla-max ability)) effort-for-level)
        display-from-effort (comp (partial display-value ability) 
                                  (partial level-from-effort ability))
        line-plot (plot display-from-effort [0 (* 1.1 E_max)] 
                        :plot-size 600
                        :color "#a0a0ff")
        all-levels-point-plot (list-plot (map #(vector (first %) (display-value ability (second %))) 
                                              effort-for-level) 
                                         :color "orange"
                                         :symbol-size 60)
        vanilla-levels-point-plot (list-plot (map #(vector (first %) (display-value ability (second %))) 
                                                  vanilla-effort-for-level)
                                             :color "lightgreen")]
    (-> (compose line-plot all-levels-point-plot vanilla-levels-point-plot)
        (axis-titles (str "Training Effort\n" "(" (:effort-units ability) ")")
                     (str (:name ability) " (" (:display-units ability) ")"))
        (assoc-in [:content :padding]  {:top 10, :left 60, :bottom 60, :right 60}))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;easy-rider/plot-ability</span>","value":"#'easy-rider/plot-ability"}
;; <=

;; @@
(use '[gorilla-repl table latex html])

(table-view [[(plot-ability speed)]
             [(plot-ability jump)]
             [(plot-ability health)]])

