;; **
;;; Define function to compute the effort required to attain various levels, and the difference in training effort between levels:
;; **

;; @@
(defn level-list [ability]
  (map inc (range (:max-level ability))))

(defn effort-list [ability] (map #(vector % (effort-from-level ability %))
                                 (level-list ability)))

(defn deltas [s]
  (loop [s s
         prev 0
         result []]
    (if (seq s)
      (recur (rest s) (first s) (conj result (- (first s) prev)))
      result)))
