;; **
;;; Define a function to return a sequence of running totals of the leading subsequences of a sequence:
;; **

;; @@
(defn running-totals [s]
  (loop [s s
         sum 0
         result []]
    (if (seq s)
      (let [new-sum (+ sum (first s))]
        (recur (rest s) new-sum (conj result new-sum)))
      result)))
