;; **
;;; 
;;; Define a function to generate row data for the health and jump training effort, and a separate function for generating speed table row data:
;; **

;; @@
(defn effort-table-rows [ability]
  (let [totals (effort-list ability) 
        steps (deltas (map second totals))]
    (map-indexed (fn [index [level total]]
                   (vector level
                           (nth steps index)
                           total))
                 totals)))

(defn join-columns [& cols]
  (partition (count cols) (apply interleave cols)))

(def speed-table-rows
  (let [levels (level-list speed)
        totals (map #(effort-from-level speed %) levels)
        speeds (map #(display-value speed %) levels)
        steps (deltas totals)
        step-times (map-indexed (fn [index step] 
                                  (/ step (display-value speed (inc index)))) 
                                steps)
        total-times (running-totals step-times)]
    (join-columns levels steps speeds step-times totals total-times)))

