;; **
;;; Define a `formatted-table` function to show a table:
;; **

;; @@
(defn mapfv [fseq xseq] (mapv #(%1 %2) fseq xseq))

(defn formatted-table [headings rows cell-formats]
  (let [formatted-rows 
        (map (fn [row] (mapfv cell-formats row)) rows)]
    (table-view formatted-rows :columns headings))) 
