;; **
;;; Define table cell formatting functions and table headings:
;; **

;; @@
(defn float-cell [n]
  (html-view (format "%.2f" n)))

(defn int-cell [n]
  (html-view (format "%,d" (Math/round n))))

(defn hms [secs]
  (let [i (int (Math/round secs))
        h (unchecked-divide-int i 3600)
        m (mod (unchecked-divide-int i 60) 60)
        s (mod i 60)]
    (format "%02d:%02d:%02d" h m s)))

(defn hms-cell [s]
  (html-view (hms s)))

(def cell-formats (list identity int-cell float-cell hms-cell int-cell hms-cell))

(def default-headings 
  (vec (map #(html-view (html [:b %])) '("Level" "Step Effort" "Total Effort"))))

(def speed-headings 
  (vec (map #(html-view (html [:b %])) '("Level" "Step Effort" "Speed" "Step Time" "Total Effort" "Total Time"))))

(def speed-table (formatted-table speed-headings speed-table-rows cell-formats))
(def jump-table (formatted-table default-headings (effort-table-rows jump) cell-formats))
(def health-table (formatted-table default-headings (effort-table-rows health) cell-formats))
